{"cells":[{"source":"<a href=\"https://www.kaggle.com/code/arpitrimza/case-study-bellabeat?scriptVersionId=99077308\" target=\"_blank\"><img align=\"left\" alt=\"Kaggle\" title=\"Open in Kaggle\" src=\"https://kaggle.com/static/images/open-in-kaggle.svg\"></a>","metadata":{},"cell_type":"markdown","outputs":[],"execution_count":0},{"cell_type":"markdown","id":"7e1cfac5","metadata":{"papermill":{"duration":0.019359,"end_time":"2022-06-22T23:17:47.188026","exception":false,"start_time":"2022-06-22T23:17:47.168667","status":"completed"},"tags":[]},"source":["# Case Study-Bellabeat: How Can a Wellness Technology Company Play It Smart?\n","\n","## Scenario\n","\n","You are a junior data analyst working on the marketing analyst team at Bellabeat, a high-tech manufacturer of health-focused products for women. Bellabeat is a successful small company, but they have the potential to become a larger player in the global smart device market. Urska Srsen, cofounder and Chief Creative Officer of Bellabeat, believes that analyzing smart device fitness data could help unlock new growth opportunities for the company. You have been asked to focus on one of Bellabeat's products and analyze smart device data to gain insight into how consumers are using their smart devices. The insights you discover will then help guide marketing strategy for the company. You will present your analysis to the Bellabeat executive team along with your high-level recommendations for Bellabeat's marketing strategy.\n","\n","## Key Professionals and products\n","\n","### Key Professionals\n","\n","* Urska Srsen: Bellabeat's cofounder and Chief Creative Officer\n","\n","* Sando Mur: Mathematician and Bellabeat's cofounder; key member of the Bellabeat executive team\n","\n","* Bellabeat marketing analytics team: A team of data analysts responsible for collecting, analyzing, and reporting data that helps guide Bellabeat's marketing strategy. You joined this team six months ago and have been busy learning about Bellabeat''s mission and business goals - as well as how you, as a junior data analyst, can help Bellabeat achieve them.\n","\n","### Products\n","\n","* Bellabeat app: The Bellabeat app provides users with health data related to their activity, sleep, stress, menstrual cycle, and mindfulness habits. This data can help users better understand their current habits and make healthy decisions. The Bellabeat app connects to their line of smart wellness products.\n","\n","* Leaf: Bellabeat's classic wellness tracker can be worn as a bracelet, necklace, or clip. The Leaf tracker connects to the Bellabeat app to track activity, sleep, and stress.\n","\n","* Time: This wellness watch combines the timeless look of a classic timepiece with smart technology to track user activity, sleep, and stress. The Time watch connects to the Bellabeat app to provide you with insights into your daily wellness.\n","\n","* Spring: This is a water bottle that tracks daily water intake using smart technology to ensure that you are appropriately hydrated throughout the day. The Spring bottle connects to the Bellabeat app to track your hydration levels.\n","\n","* Bellabeat membership: Bellabeat also offers a subscription-based membership program for users. Membership gives users 24/7 access to fully personalized guidance on nutrition, activity, sleep, health and beauty, and mindfulness based on their lifestyle and goals.\n","\n","## About the company\n","\n","Urska Srsen and Sando Mur founded Bellabeat, a high-tech company that manufactures health-focused smart products. Srsen used her background as an artist to develop beautifully designed technology that informs and inspires women around the world. Collecting data on activity, sleep, stress, and reproductive health has allowed Bellabeat to empower women with knowledge about their own health and habits. Since it was founded in 2013, Bellabeat has grown rapidly and quickly positioned itself as a tech-driven wellness company for women.\n","\n","By 2016, Bellabeat had opened offices around the world and launched multiple products. Bellabeat products became available through a growing number of online retailers in addition to their own e-commerce channel on their website. The company has invested in traditional advertising media, such as radio, out-of-home billboards, print, and television, but focuses on digital marketing extensively. Bellabeat invests year-round in Google Search, maintaining active Facebook and Instagram pages, and consistently engages consumers on Twitter. Additionally, Bellabeat runs video ads on Youtube and display ads on the Google Display Network to support campaigns around key marketing dates.\n","\n","Srsen knows that an analysis of Bellabeat's available consumer data would reveal more opportunities for growth. She has asked the marketing analytics team to focus on a Bellabeat product and analyze smart device usage data in order to gain insight into how people are already using their smart devices. Then, using this information, she would like high-level recommendations for how these trends can inform Bellabeat marketing strategy.\n","\n","## 1. Ask\n","\n","Srsen asks you to analyze smart device usage data in order to gain insight into how consumers use non-Bellabeat smart devices. She then wants you to select one Bellabeat product to apply these insights to in your presentation. These questions will guide your analysis:\n","\n","* What are some trends in smart device usage?\n","\n","* How could these trends apply to Bellabeat customers?\n","\n","* How could these trends help influence Bellabeat marketing strategy?\n","\n","### Business Task\n","\n","To find out the relationship between different variables and patterns in the data that can help identify trends and patterns in smart device usage, how could these trends be applied to Bellabeat customers and how could these trends help influence Bellabeat marketing strategy?\". Using insights from the data, trends in smart device usage can be clearly identified in order to influence Bellabeat marketing strategy for increasing profits and business growth in the future.\n","\n","\n","## 2. Prepare\n","\n","Srsen encourages you to use public data that explores smart device users' daily habits. She points you to a specific data set: [FitBit Fitness Tracker Data](https://www.kaggle.com/datasets/arashnic/fitbit) a public domain dataset. This Kaggle data set contains personal fitness tracker from thirty fitbit users. Thirty eligible Fitbit users consented to the submission of personal tracker data, including minute-level output for physical activity, heart rate, and sleep monitoring. It includes information about daily activity, steps, and heart rate that can be used to explore users' habits.\n","\n","### Installing and loading common packages and libraries\n"]},{"cell_type":"code","execution_count":1,"id":"7c388fe0","metadata":{"execution":{"iopub.execute_input":"2022-06-22T23:17:47.229254Z","iopub.status.busy":"2022-06-22T23:17:47.226863Z","iopub.status.idle":"2022-06-22T23:19:24.491983Z","shell.execute_reply":"2022-06-22T23:19:24.48959Z"},"papermill":{"duration":97.289597,"end_time":"2022-06-22T23:19:24.49595","exception":false,"start_time":"2022-06-22T23:17:47.206353","status":"completed"},"tags":[]},"outputs":[{"name":"stderr","output_type":"stream","text":["Installing package into ‘/usr/local/lib/R/site-library’\n","(as ‘lib’ is unspecified)\n","\n","── \u001b[1mAttaching packages\u001b[22m ─────────────────────────────────────── tidyverse 1.3.1 ──\n","\n","\u001b[32m✔\u001b[39m \u001b[34mggplot2\u001b[39m 3.3.6     \u001b[32m✔\u001b[39m \u001b[34mpurrr  \u001b[39m 0.3.4\n","\u001b[32m✔\u001b[39m \u001b[34mtibble \u001b[39m 3.1.7     \u001b[32m✔\u001b[39m \u001b[34mdplyr  \u001b[39m 1.0.9\n","\u001b[32m✔\u001b[39m \u001b[34mtidyr  \u001b[39m 1.2.0     \u001b[32m✔\u001b[39m \u001b[34mstringr\u001b[39m 1.4.0\n","\u001b[32m✔\u001b[39m \u001b[34mreadr  \u001b[39m 2.1.2     \u001b[32m✔\u001b[39m \u001b