","\n","* There are 33 distinct users' records available in the daily_activity dataset, 24 in the sleep_day dataset, and only 8 distinct ids have updated their records in the weight_log_info dataset.\n","\n","* No noticeable weight change was seen among those 8 individuals. Hence, this dataset will not be used for analysis because the sample size is so tiny and there were no changes in the variable values.\n","\n","\n","## 3. Process\n","\n","### Cleaning the data, and preparing it for analysis\n","\n","Now that all the daily data is at one location, it can be concentrated to see if there are any trends. The main focus of the analysis will be on the amount of calories burned by activity type and user as well as the relationship between activity and sleep quality. In order to do that, new summarised tables can be created in which certain data points can be grouped into easier-to-understand categories for the study.\n","\n","### Making the column names consistent \n","\n","The uniqueness and consistency of the column names are ensured by the clean_names() method. This guarantees that the names contain just letters, digits, and underscores.\n","\n","Converting the date columns \"activity_date\" and \"sleep_day\" in daily_activity and sleep_day dataframes respectively from character to date datatype and renaming both the columns to \"date\"."]},{"cell_type":"code","execution_count":34,"id":"9a8d99af","metadata":{"execution":{"iopub.execute_input":"2022-06-22T23:19:27.257598Z","iopub.status.busy":"2022-06-22T23:19:27.256366Z","iopub.status.idle":"2022-06-22T23:19:27.462297Z","shell.execute_reply":"2022-06-22T23:19:27.46072Z"},"papermill":{"duration":0.232136,"end_time":"2022-06-22T23:19:27.464602","exception":false,"start_time":"2022-06-22T23:19:27.232466","status":"completed"},"tags":[]},"outputs":[{"data":{"text/html":["<style>\n",".list-inline {list-style: none; margin:0; padding: 0}\n",".list-inline>li {display: inline-block}\n",".list-inline>li:not(:last-child)::aft