ints as achievements and the business may offer them a giftcard redeemable for the points on accumulation of a certain number of points.\n","\n","* The step count for the users using Bellabeat app should be set per hour rather than by day. \n","\n","* The users could participate in various Sunday activity challenges to encourage Sunday activity. On Sundays, they could also feature some workout videos.\n","\n","* According to the analysis of the users' sleep patterns, 50% of them sleep for fewer than 7 hours per night on average.\n","\n","* In this case, facility may be provided to users to choose their preferred bed time via a mobile app, and the app should notify them 20 minutes prior to that time so they can get ready for sleep. Additionally, the app should offer features like sleep music or audio books, which would be especially beneficial for people who have trouble falling asleep.\n","\n","* Sedentary Minutes and Total Minutes Asleep are inversely correlated, thus Bellabeat app might suggest reducing sedentary time if users wish to improve their sleep.\n"]}],"metadata":{"kernelspec":{"display_name":"R","language":"R","name":"ir"},"language_info":{"codemirror_mode":"r","file_extension":".r","mimetype":"text/x-r-source","name":"R","pygments_lexer":"r","version":"4.0.5"},"papermill":{"default_parameters":{},"duration":116.439084,"end_time":"2022-06-22T23:19:40.470129","environment_variables":{},"exception":null,"input_path":"__notebook__.ipynb","output_path":"__notebook__.ipynb","parameters":{},"start_time":"2022-06-22T23:17:44.031045","version":"2.3.4"}},"nbformat":4,"nbformat_minor":5}